import React, { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCheck } from '@fortawesome/free-solid-svg-icons';
import useAxios from 'axios-hooks';
import axios from '../../store/axios-instance';
import './Services.scss';

const Services = () => {

    const [ servicesInfo, setServicesInfo ] = useState(new Map() );

    const fetchData = async () => {
        const result = await axios('/services.json');


        console.log('===result.data===', result.data.services );
       //setServicesInfo(result.data.services);

        const updateMap = (k,v) => {
            setServicesInfo( result.data.services.set(k,v));
        }
    };

    useEffect (() => {
        document.title = "Container Logistik – ein Partner und alle Leistungen | Kaefer Logistik";

        fetchData();

    }, []);


    console.log('==== servicesInfo ======', servicesInfo);


    return (
        <div className="Services">
            {
                <React.Fragment>
                    <ul>
                        {[...servicesInfo.keys()].map(k => (
                            <li key={k}>servicesInfo.get(k)</li>
                        ))}
                    </ul>

                </React.Fragment>
            }
        </div>
    );
};

export default Services;
